import React, { useEffect, useState } from 'react'
import { useAuth } from '../Context/AuthContext'
import axios from 'axios';
import { useNavigate } from 'react-router-dom';


const Dashboard = () => {
    const {authuser} = useAuth();
    const [data, setData] = useState([]);
    const [datat, setdatat] = useState([])
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);
    const route = "http://localhost:5000";  
    const navigate = useNavigate();
    const [isstudent, setisstudent] = useState()
    const conditonalrendering = () =>{
        if(authuser.user.role == "principal"){
            return <div className="container mt-5">
            <h2>Teacher</h2>
            <table className="table table-dark table-bordered">
                <thead className='thead-light m-1'>
                    <tr>
                        <th>ID</th>
                        <th>Name</th>
                        <th>Age</th>
                        <th>Date of Birth</th>
                        <th>Email</th>
                        <th>Role</th>
                        <th>Delete</th>
                        <th>Edit</th>
                    </tr>
                </thead>
                <tbody>
                    {data.map((item, index) => (
                        <tr key={index}>
                            <td>{item._id}</td>
                            <td>{item.name || 'N/A'}</td>
                            <td>{item.age || 'N/A'}</td>
                            <td>{item.dob || 'N/A'}</td>
                            <td>{item.email}</td>
                            <td>{item.role}</td>
                            <td><button className='btn btn-danger' onClick={(e)=>{deleteentry(item._id)}}>Delete</button></td>
                            <td><button className='btn btn-success' onClick={(e)=>{editentry(item._id)}}>Edit</button></td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
        }else if(authuser.user.role == "teacher"){
            
        }
    }
    const refreshdatabase = async()=>{
        axios.get(route+'/api/getteacher') // Replace with your actual API endpoint
            .then(response => {
                setData(response.data);
                setLoading(false);
            })
            .catch(error => {
                console.error('There was an error fetching the data!', error);
                setError(error);
                setLoading(false);
            });
        axios.get(route+'/api/getstudent') // Replace with your actual API endpoint
            .then(response => {
                setdatat(response.data);
                setLoading(false);
            })
            .catch(error => {
                console.error('There was an error fetching the data!', error);
                setError(error);
                setLoading(false);
            });
    }

    const deleteentry = (props)=>{
        axios.get(route+'/api/datadelete/'+props)
            .then(response =>{
                refreshdatabase()
            })
    }

    const editentry = (id) => {
        navigate(`/edituser/${id}`);
    };
    useEffect(() => {
        // Fetch data from the API endpoint
        axios.get(route+'/api/getteacher') // Replace with your actual API endpoint
            .then(response => {
                setData(response.data);
                setLoading(false);
            })
            .catch(error => {
                console.error('There was an error fetching the data!', error);
                setError(error);
                setLoading(false);
            });
        axios.get(route+'/api/getstudent') // Replace with your actual API endpoint
            .then(response => {
                setdatat(response.data);
                setLoading(false);
            })
            .catch(error => {
                console.error('There was an error fetching the data!', error);
                setError(error);
                setLoading(false);
            });
    }, []); // Empty dependency array to run once on component mount
    if (loading) return <p>Loading...</p>;
    if (error) return <p>There was an error loading the data!</p>;
  return (<>
  
   <nav class="navbar container navbar-expand-lg navbar-light bg-light">
  <a class="navbar-brand" href="#"></a>
  <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
    <span class="navbar-toggler-icon"></span>
  </button>
  <div class="collapse navbar-collapse" id="navbarNav">
    <ul class="navbar-nav">
      <li class="nav-item active">
        <a class="nav-link" href="/adduser">Add Student or Teacher</a>
      </li>
      <li class="nav-item">
        <a class="nav-link" href="#">Create a classroom</a>
      </li>
      <li class="nav-item">
        <a class="nav-link" href="#">Classrooms </a>
      </li>
    </ul>
  </div>
</nav>
<div>Dashboard</div>{conditonalrendering()}

        <div className="container mt-5">
            <h2>Students</h2>
            <table className="table table-dark table-bordered">
                <thead className='thead-light m-1'>
                    <tr>
                        <th>ID</th>
                        <th>Name</th>
                        <th>Age</th>
                        <th>Date of Birth</th>
                        <th>Email</th>
                        <th>Role</th>
                        <th>Delete</th>
                        <th>Edit</th>
                    </tr>
                </thead>
                <tbody>
                    {datat.map((item, index) => (
                        <tr key={index}>
                            <td>{item._id}</td>
                            <td>{item.name || 'N/A'}</td>
                            <td>{item.age || 'N/A'}</td>
                            <td>{item.dob || 'N/A'}</td>
                            <td>{item.email}</td>
                            <td>{item.role}</td>
                            <td><button className='btn btn-danger' onClick={(e)=>{deleteentry(item._id)}}>Delete</button></td>
                            <td><button className='btn btn-success' onClick={(e)=>{editentry(item._id)}}>Edit</button></td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
  </>
    
    
  )
}

export default Dashboard
